      ),
    },
    {
      value: years[11],
      label: (
        <div className="dateOptions">
          {years[11]}
        </div>
      ),
    },
    {
      value: years[12],
      label: (
        <div className="dateOptions">
          {years[12]}
        </div>
      ),
    },
    {
        value: years[13],
        label: (
          <div className="dateOptions">
            {years[12]}
          </div>
        ),
      },
      {
        value: years[14],
        label: (
          <div className="dateOptions">
            {years[12]}
          </div>
        ),
      },
  ];
    return(
    <Select
        name="sector"
        id="sector"
        placeholder="2021"

        className="chooseCountrySelect"
        options={optionsSector}
style={{
  backgroundImage: `url(${dateIcon})`,
  backgroundRepeat: "no-repeat",
  width: "50%",
  backgroundPosition: "right 6% top 50%",
}}
        onChange={(e)=>Selected(e)}
      />
    )
}
export default SelectedYear
